import {useState} from "react"
import './App.css';
import Navbar from "./components/navbar/Navbar";



function App() {

  const [user, setUser] = useState([]) 


  return (
    <div className="App">
      <Navbar user={user} />
      <main>
        <div className="no-users">
          <h2>Content</h2>
        </div>
      </main>
    </div>
  );
    }


export default App;
